Output to gcode then print.
For the record, the aggregation part I did in OpenSCAD and the script looks like this:
// Wade's Geared Extruded - single print bed<br />
translate([0,64,0])<br />
{<br />
// big gear<br />
translate([31,-33,0])<br />
import_stl(&quot;39t17p.stl&quot;, convexity = 100);
<code >// small gear
translate([70,-51,0])
import_stl("11t17p.stl", convexity = 100);

// Extruder idler block
translate([65,-38,0])
import_stl("M8_Extruder_Idler_Block_2.stl", convexity = 100);

// Extruder block
import_stl("M8_Extruder_Block_3.stl", convexity = 100);</code>
